import Vue from 'vue'
import App from './App.vue'
// 按需引用
import {
  Message
} from 'element-ui';
// 全局组件
import Header from './components/Header'

// 引人route
import router from './router'


Vue.component('Header',Header)
Vue.prototype.$message = Message

Vue.config.productionTip = false

new Vue({
  render: h => h(App),
  router
}).$mount('#app')
